import React from 'react'

const Form = () => {
  return (
    <Form>
        <label htmlFor="email">EMAIL</label>
        <input type="email" placeholder='Tu email...' name='email'></input>
        
        <label htmlFor='password'>PASSWORD</label>
        <input type="password" placeholder='Tu password...' name='password'></input>

        <button>Submit</button>
    </Form>
  )
}

export default Form
